A short video describing the characters of the new season of Dallas.

============================================
Relive our family history in less time than it takes to craft a decent revenge plot. Get ready for the series premiere of Dallas by watching this recap of all the pivotal events that have happened so far. Don't miss the two-hour series premiere event Wednesday, June 13 at 9/8c on TNT.

DALLAS is an all-new series based upon one of the most popular television dramas of all time, about the bitter rivalries and family power struggles within a Texas oil and cattle-ranching dynasty.

